function n(t,s){const{width:e,height:l}=s;if(e<3||l<3)throw new Error("Board must have at least 3x3 cells");const r=[];for(let c=0;c<l;c++){const i=[];for(let h=0;h<e;h++)c<=0||h<=0||c>=l-1||h>=e-1?i.push(s.outline):i.push(s.inside);r.push(i)}return{cells:r,width:e,height:l}}function o(t){return{width:t.width,height:t.height,cells:t.cells.map(s=>s.slice())}}function u(t,s){for(let e=0;e<t.cells.length;e++)for(let l=0;l<t.cells[e].length;l++)s.cells[e][l]=t.cells[e][l]}export{o as a,u as b,n as c};
